(15, 'super spectacol nr 2', 'http://google.ro', 'LOREM', 'assets/uploads/10151818_831278253568036_6356999988997061138_n.jpg', 'It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using ''Content here, content here'', making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for ''lorem ipsum'' will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).', 1, '2014-04-22 20:30:37', 1, 'nr 43', 34, 'ALB', '2014-04-20 16:08:00', '2014-04-26 16:14:00'),
(16, 'Nazir', '', '', 'assets/uploads/nazir.jpg', 'Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source. Lorem Ipsum comes from sections 1.10.32 and 1.10.33 of "de Finibus Bonorum et Malorum" (The Extremes of Good and Evil) by Cicero, written in 45 BC. This book is a treatise on the theory of ethics, very popular during the Renaissance. The first line of Lorem Ipsum, "Lorem ipsum dolor sit amet..", comes from a line in section 1.10.32', 30, '2014-04-23 19:30:22', 1, 'Str. Petru Rares, nr.14', 3022, 'ROM', '2014-04-26 22:27:00', '2014-04-26 23:59:00'),
(17, 'Spectacol mai', '', '', 'assets/uploads/1983Porsche.jpg', 'Lorem Ipsum este pur ?i simplu o machet? pentru text a industriei tipografice. Lorem Ipsum a fost macheta standard a industriei înc? din secolul al XVI-lea, când un tipograf anonim a luat o plan?et? de litere ?i le-a amestecat pentru a crea o carte demonstrativ? pentru literele respective. Nu doar c? a supravie?uit timp de cinci secole, dar ?i a facut saltul în tipografia electronic? practic neschimbat?. A fost popularizat? în anii ''60 odat? cu ie?irea colilor Letraset care con?ineau pasaje Lorem Ipsum, iar mai recent, prin programele de publicare pentru calculator, ca Aldus PageMaker care includeau versiuni de Lorem Ipsum.', 30, '2014-04-23 19:38:24', 6, 'Park', 653, 'ESP', '2014-05-08 22:36:00', '2014-05-15 22:36:00'),
